pragma solidity ^0.8.20;



contract E721A is ERC721A, Ownable(msg.sender) {

    constructor() ERC721A("e721a", "721a") {}

    

    function mint(uint n) public onlyOwner 
    {
        _safeMint(msg.sender,n);
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        if (!_exists(tokenId)) _revert(URIQueryForNonexistentToken.selector);

        string memory baseURI = _baseURI();
        return bytes(baseURI).length != 0 ? string(abi.encodePacked(_baseURI(), toString(tokenId),".json")) : '';
    }
